  \"photosynthetic-active-radiation-par-profile-data-collected-in-the-north-atlantic-ocean-on-the-e\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0106520 includes profile
  and physical data collected aboard the ENDEAVOR during cruises EN259, EN262, EN264,
  EN266 and EN267I in the North Atlantic Ocean from 1995-01-12 to 1995-06-04. These
  data include PHOTOSYNTHETIC ACTIVE RADIATION (PAR). The instruments used to collect
  these data include radiometer and PAR Sensor. These data were collected by Jeff
  Van Keuren of Woods Hole Oceanographic Institution as part of GB. The Biological
  and Chemical Oceanography Data Management Office (BCO-DMO) submitted these data
  to NODC on 2013-04-25.nnThe following is the text of the abstract provided by BCO-DMO:nnPhotosynthetically
  Available RadiationnnMost information regarding individual profiles is provided
  with the individual data files (location, correction to GMT, light units, sensor
  type and characteristics, date of latest calibration).nUpcast and downcast profiles
  sorted separately by depth, then time. Downcast listed first. Raw values listed
  - no averaging.nAll profiles were taken with the same two (Biospherical Instruments,
  Inc. San Diego, CA) instruments: underwater unit (PUV-500) and matched deck unit
  (PUV-510). Last Calibration of Sensors: 15 DEC 95.nThe December 1995 recalibration
  results have been applied to all readings. The change in calibrations from the previous
  April 1993 factory measurements were less than 2%.nAll profiles were taken from
  same location on the R/V Endeavor: starboard side using the J-frame. Whenever sea
  condition allowed, the ship was turned such that the sun was shining on the starboard
  side and as close to amidship as possible.nnContributor:nDr Jeff Van KeurennWood
  Hole Oceanographic Inst.nMS#35nWoods Hole, MA 02543-1521nnUpdated: August 31, 2004;
